import { useState } from "react";
import { Route, Switch, withRouter, Redirect } from "react-router-dom";
import { TakeTest } from ".";
import TestsGrid from "../components/testsGrid";

function Tests() {
  const [test, setTest] = useState();

  const handleCallback = (childData) => {
    setTest(childData);
    console.log(test);
  };

  return (
    <>
      {test && <Redirect to="tests/takeTest" />}
      <Switch>
        {test && (
          <Route
            path="/tests/takeTest"
            render={(props) => <TestsGrid {...props} test={test} />}
          />
        )}
        <Route
          path="/tests"
          render={(props) => (
            <TestsGrid {...props} parentCallBack={handleCallback} />
          )}
        />
      </Switch>
    </>
  );
}

export default withRouter(Tests);
